      <GalleryCard
        imageSrc="https://via.placeholder.com/600x400"
        title="Beautiful Landscape 1"
        description="A breathtaking view of nature's beauty."
      />
      <GalleryCard
        imageSrc="https://via.placeholder.com/600x400"
        title="Beautiful Landscape 2"
        description="Another stunning view of nature."
      />
      {/* Add more GalleryCard components here */}
    </div>
  );
};

export default Gallery;
